import React from "react";
import Header from "../Components/Header";
import HomeCarusel from "../Components/HomeCarusel";
import { Container } from "react-bootstrap";

const Home = () => {
  return (
    <>
      <Header />
      <Container>

      <HomeCarusel />
      </Container>
    </>
  );
};

export default Home;
